import React from 'react';
import classes from './MyPosts.module.css';


const MyPosts = () => {
  return (
<div className={classes.item}>
      <div>
        My posts
        </div>

      <div>New post</div>
      <div>Post 1</div>
      <div>Post 2</div>
</div>
  );
}

export default MyPosts;
